import React, { useState } from 'react';
import { Link } from "react-router-dom";
import { Nav, NavItem, NavLink, UncontrolledTooltip, Dropdown, DropdownItem, DropdownToggle, DropdownMenu } from "reactstrap";
import classnames from "classnames";
import { connect, useDispatch, useSelector } from "react-redux";
import { useNavigate } from "react-router-dom";  // Import useNavigate

import { setActiveTab, changeLayoutMode } from "../../redux/actions";

// Import Images
import logo from "../../assets/images/logo.svg"
import avatar1 from "../../assets/images/users/avatar-1.jpg";

// i18n
import i18n from '../../i18n';

// Flags
import usFlag from "../../assets/images/flags/us.jpg";
import spain from "../../assets/images/flags/spain.jpg";
import germany from "../../assets/images/flags/germany.jpg";
import italy from "../../assets/images/flags/italy.jpg";
import russia from "../../assets/images/flags/russia.jpg";
import { createSelector } from 'reselect';

function LeftSidebarMenu(props) {
    const dispatch = useDispatch();
    const navigate = useNavigate();
    const profileState = useSelector((state) => state.Profile.profile);

    const selectLayoutProperties = createSelector(
        (state) => state.Layout,
        (layout) => ({
            layoutMode: layout.layoutMode,
        })
    );

    const { layoutMode } = useSelector(selectLayoutProperties);

    const mode = layoutMode === "dark" ? "light" : "dark";

    const onChangeLayoutMode = (value) => {
        if (changeLayoutMode) {
            dispatch(changeLayoutMode(value));
        }
    }

    const [dropdownOpen, setDropdownOpen] = useState(false);
    const [dropdownOpen2, setDropdownOpen2] = useState(false);
    const [dropdownOpenMobile, setDropdownOpenMobile] = useState(false);
    const [lng, setLng] = useState("English");

    const toggle = () => setDropdownOpen(!dropdownOpen);
    const toggle2 = () => setDropdownOpen2(!dropdownOpen2);
    const toggleMobile = () => setDropdownOpenMobile(!dropdownOpenMobile);

    const toggleTab = tab => {
        props.setActiveTab(tab)
    }

    const activeTab = props.activeTab;

    /* Changes language according to clicked language menu item */
    const changeLanguageAction = (lng) => {
        i18n.changeLanguage(lng);

        if (lng === "sp") setLng("Spanish");
        else if (lng === "gr") setLng("German");
        else if (lng === "rs") setLng("Russian");
        else if (lng === "it") setLng("Italian");
        else if (lng === "eng") setLng("English");
    }

    return (
        <React.Fragment>
            <div className="side-menu flex-lg-column me-lg-1">
                {/* LOGO */}
                <div className="navbar-brand-box">
                    <Link to="/" className="logo logo-dark">
                        <span className="logo-sm">
                            <img src={logo} alt="logo" height="30" />
                        </span>
                    </Link>

                    <Link to="/" className="logo logo-light">
                        <span className="logo-sm">
                            <img src={logo} alt="logo" height="30" />
                        </span>
                    </Link>
                </div>
                {/* End navbar-brand-box */}

                {/* Start side-menu nav */}
                <div className="flex-lg-column my-auto">
                    <Nav className="side-menu-nav nav-pills justify-content-center" role="tablist">
                        <NavItem id="profile">
                            <NavLink
                                id="pills-user-tab"
                                className={classnames({ active: activeTab === 'profile' }) + " mb-2"}
                                onClick={() => { toggleTab('profile'); }}
                            >
                                <i className="ri-user-2-line"></i>
                            </NavLink>
                        </NavItem>
                        <UncontrolledTooltip target="profile" placement="top">Profile</UncontrolledTooltip>
                        <NavItem id="Chats">
                            <NavLink
                                id="pills-chat-tab"
                                className={classnames({ active: activeTab === 'chat' }) + " mb-2"}
                                onClick={() => { toggleTab('chat'); }}
                            >
                                <i className="ri-message-3-line"></i>
                            </NavLink>
                        </NavItem>
                        <UncontrolledTooltip target="Chats" placement="top">Chats</UncontrolledTooltip>
                        <NavItem id="Groups">
                            <NavLink
                                id="pills-groups-tab"
                                className={classnames({ active: activeTab === 'group' }) + " mb-2"}
                                onClick={() => { toggleTab('group'); }}
                            >
                                <i className="ri-group-line"></i>
                            </NavLink>
                        </NavItem>
                        <UncontrolledTooltip target="Groups" placement="top">Groups</UncontrolledTooltip>
                        <NavItem id="Contacts">
                            <NavLink
                                id="pills-contacts-tab"
                                className={classnames({ active: activeTab === 'contacts' }) + " mb-2"}
                                onClick={() => { toggleTab('contacts'); }}
                            >
                                <i className="ri-contacts-line"></i>
                            </NavLink>
                        </NavItem>
                        <UncontrolledTooltip target="Contacts" placement="top">Contacts</UncontrolledTooltip>
                        <NavItem id="Settings">
                            <NavLink
                                id="pills-setting-tab"
                                className={classnames({ active: activeTab === 'settings' }) }
                                onClick={() => { toggleTab('settings'); }}
                            >
                                <i className="ri-settings-2-line"></i>
                            </NavLink>
                        </NavItem>
                        <UncontrolledTooltip target="Settings" placement="top">Settings</UncontrolledTooltip>
                        <Dropdown nav isOpen={dropdownOpenMobile} toggle={toggleMobile} className="profile-user-dropdown d-inline-block d-lg-none dropup">
                            <DropdownToggle nav>
                                <img src={avatar1} alt="chatvia" className="profile-user rounded-circle" />
                            </DropdownToggle>
                            <DropdownMenu className="dropdown-menu-end">
                                <DropdownItem onClick={() => { toggleTab('profile'); }}>
                                    Profile <i className="ri-profile-line float-end text-muted"></i>
                                </DropdownItem>
                                <DropdownItem onClick={() => { toggleTab('settings'); }}>
                                    Setting <i className="ri-settings-3-line float-end text-muted"></i>
                                </DropdownItem>
                                <DropdownItem divider />
                                <DropdownItem href="/logout">
                                    Log out <i className="ri-logout-circle-r-line float-end text-muted"></i>
